_prior_to_cleaning_5_3)\n","    * [5.4 Dataset Cleaning](#dataset_cleaning_5_4)\n","        * [5.4.1 Duplicates](#duplicates_5_4_1)\n","        * [5.4.2 Consistancy](#consistancy_5_4_2)\n","* [6. Analysis](#analysis_6)\n","    * [6.1 Analysis Phase of Activity](#analysis_of_activity_6_1)\n","    * [Analysis Phase of Sleep](#analysis_of_sleep_6_2)\n","        * [6.2.1 Analysis of Sleep and Activity](#analysis_of_sleep_and_activity_6_2_1)\n","    * [6.3 Analysis of steps](#analysis_of_steps_6_3)\n","        * [6.3.1 Weekly Steps](#weekly_steps_6_3_1)\n","    * [6.4 Sleep throughout the Week](#sleep_throughtout_the_week_6_4)\n","    * [6.5 Classification of Sleep](#classification_of_sleep_6_5)\n","    * [6.6 Analysis of BMI](#analysis_of_bmi_6_6)\n","* [7. Conclusion](#conclusion_7)\n","    * [Recommendation 1](#recommendation_7_1)\n","    * [Recommendation 2](#recommendation_7_2)\n","    * [Recommendation 3](#recommendation_7_3)\n","    * [Recommendation 4](#recommendation_7_4)\n","    * [Recommendation 5](#recommendation_7_5)\n","* [8. Final Points](#recommendation_7_6)\n","    * [8.1 Slideshow](#presentation_7_7)\n","\n","\n","# <span style=\"color:#4682B4\"> 1. Summary </span> <a class=\"anchor\" id=\"summary_1\"></a>\n","![Screen Shot 2023-03-20 at 3.40.55 PM.png](attachment:4f785b5a-f033-4ba6-9c0d-e4d955c626a4.png)\n","\n","<br>\n","\n","### <span style=\"color:#4682B4\"> 1.1 About the Company </span> <a class=\"anchor\" id=\"about_the_company_1_1\"></a>\n","\n","Bellabeat is a technology company that designs and produces innovative health and wellness-focused smart products for women. The company was founded in 2013 and is headquartered in San Francisco, California. Their product line includes smart jewelry, smart water bottles, and activity trackers to help women track and improve their health and wellness. Bellabeat's products use data tracking and analysis to give users insights into their daily activity, sleep patterns, and stress levels. The company's mission is to empower women to take control of their health and wellness by providing them with the tools and information they need to live healthier lives.\n","\n","\n","### <span style=\"color:#4682B4\"> 1.2 About the Products </span> <a class=\"anchor\" id=\"about_the_products_1_2\"></a>\n","\n","* **Bellabeat app**: A comprehensive tool that empowers users with health-related information pertaining to their activity, sleep, stress, menstrual cycle, and mindfulness routines. By utilizing this app, users can better understand their current habits and make informed decisions to improve their overall well-being. Additionally, the Bellabeat app is compatible with its range of smart wellness products.\n","\n","* **Leaf**: A versatile device worn as a bracelet, necklace, or clip. Connecting to the Bellabeat app can track user activity, sleep, and stress levels, providing valuable insights for improving their overall health.\n","\n","* **Time**: The wellness watch combines a classic timepiece design with advanced technology to track activity, sleep, and stress levels. The watch integrates with the Bellabeat app to comprehensively view daily wellness.\n","Spring: Spring water bottle that tracks daily water intake using smart technology to ensure optimal daily hydration. The Spring bottle connects to the Bellabeat app, allowing users to monitor their hydration levels easily.\n","\n","* **Bellabeat membership**: A personalized guidance on nutrition, activity, sleep, health, beauty, and mindfulness-based on each member's lifestyle and goals. With 24/7 access to this program, users can receive tailored support to achieve their wellness objectives.\n","\n"]},{"cell_type":"markdown","id":"d45a3186","metadata":{"papermill":{"duration":0.029491,"end_time":"2023-03-27T21:31:57.311374","exception":false,"start_time":"2023-03-27T21:31:57.281883","status":"completed"},"tags":[]},"source":["# <span style=\"color:#4682B4\"> 2.  Ask Phase </span> <a class=\"anchor\" id=\"ask_phase_2\"></a>\n","\n","## <span style=\"color:#4682B4\"> 2.1 Business Task </span> <a class=\"anchor\" id=\"business_task_2_1\"></a>\n","\n","Based on the trends in smart device usage, identify possible avenues for expansion and propose enhancements to the Bellabeat marketing strategy.\n","\n","## <span style=\"color:#4682B4\"> 2.1.1 Questions for the Analyst </span> <a class=\"anchor\" id=\"question_for_analyst_2_1_1\"></a>\n","\n","* What are some trends in smart device usage?\n","* How could these trends apply to Bellabeat customers?\n","* How could these trends help influence Bellabeat marketing strategy\n","\n","### <span style=\"color:#4682B4\"> 2.2 Stakeholders </span> <a class=\"anchor\" id=\"stakeholders_2_2\"></a>\n","\n","> * Urška Sršen: The co-founder and CCO of Bellabeat\n",">  \n","> * Sando Mur: - The co-founder and executive member of Bellabeat\n","> \n","> * Bellabeat Marketing Analytics team\n"]},{"cell_type":"markdown","id":"f1c047ec","metadata":{"papermill":{"duration":0.031249,"end_time":"2023-03-27T21:31:57.373026","exception":false,"start_time":"2023-03-27T21:31:57.341777","status":"completed"},"tags":[]},"source":["# <span style=\"color:#4682B4\"> 3.  Prepare Phase </span> <a class=\"anchor\" id=\"prepare_phase_3\"></a>\n","\n","## <span style=\"color:#4682B4\"> 3.1 Dataset </span> <a class=\"anchor\" id=\"dataset_3_1\"></a>\n","\n","The dataset is sourced from the Mobius FitBit Fitness Tracker Data in Kaggle. The information about the case study is from the Google Data Analytics Case Study 2.\n","\n","****\n","### <span style=\"color:#4682B4\"> 3.2 About the Dataset </span> <a class=\"anchor\" id=\"about_the_dataset_3_2\"></a>\n","\n","The Fitbit Fitness Tracker Data contains 17 datasets regarding data collected on users. The datasets used in this Case Study are:\n","* **Daily Activity**: 33 users' data over one month. It includes Steps, Distance, Intensities, and Calories.\n","* **Sleep Data**: 21 users' data tracking sleep. It includes the total sleeps a day, total minutes asleep, and total minutes in bed.\n","* **Steps Data**: 33 users data over the course of one month.\n","* **Weight Log Data**: 8 users' data tracking their weight by day. For this case study, I will be using users' BMI.\n","\n","\n","\n","### <span style=\"color:#4682B4\"> 3.3 Other notes on data </span> <a class=\"anchor\" id=\"other_notes_on_dataset_3_3\"></a>\n","\n","The data contains a minimal sample size of users (33 users). This will cause the case study to have a sampling bias and will not represent the entire population or the entire population of users with a FitBit Fitness Tracker.\n","\n","\n","\n"]},{"cell_type":"markdown","id":"0f5c0859","metadata":{"papermill":{"duration":0.029624,"end_time":"2023-03-27T21:31:57.433325","exception":false,"start_time":"2023-03-27T21:31:57.403701","status":"completed"},"tags":[]},"source":["# <span style=\"color:#4682B4\"> 4. Preparing to Analyze </span> <a class=\"anchor\" id=\"prepare_to_analyze_4\"></a>\n","\n","This case study will analyze the data using R. R is a programming language and software environment for statistical computing and graphics. R is designed specifically for statistical computing, data analysis, and visualization. It provides various statistical and graphical techniques, including linear and nonlinear modeling, classical statistical tests, time-series analysis, classification, clustering, and more."]},{"cell_type":"markdown","id":"83a24471","metadata":{"papermill":{"duration":0.029509,"end_time":"2023-03-27T21:31:57.49229","exception":false,"start_time":"2023-03-27T21:31:57.462781","status":"completed"},"tags":[]},"source":["# <span style=\"color:#4682B4\"> 5. Process Phase </span> <a class=\"anchor\" id=\"process_phase_5\"></a>\n","\n","\n","### <span style=\"color:#4682B4\"> 5.1 Packages </span> <a class=\"anchor\" id=\"packages_5_1\"></a>\n","I will begin by installing various vital packages into the Rstudios Project."]},{"cell_type":"code","execution_count":1,"id":"0427