d7780d","metadata":{"papermill":{"duration":0.029567,"end_time":"2023-03-27T21:31:59.101881","exception":false,"start_time":"2023-03-27T21:31:59.072314","status":"completed"},"tags":[]},"source":["### <span style=\"color:#4682B4\"> 5.2 Importing the Data </span> <a class=\"anchor\" id=\"importing_the_data_5_2\"></a>\n","\n","\n","Now that the essential packages are installed, I can import the dataset I will use in my analysis.\n","Again, the dataset I will be using are:\n","* Daily Activity\n","* Sleep Data\n","* Steps Data\n","* Weight Log Data"]},{"cell_type":"code","execution_count":2,"id":"cbeea5c5","metadata":{"execution":{"iopub.execute_input":"2023-03-27T21:31:59.195896Z","iopub.status.busy":"2023-03-27T21:31:59.164144Z","iopub.status.idle":"2023-03-27T21:31:59.343086Z","shell.execute_reply":"2023-03-27T21:31:59.340821Z"},"papermill":{"duration":0.215309,"end_time":"2023-03-27T21:31:59.346802","exception":false,"start_time":"2023-03-27T21:31:59.131493","status":"completed"},"tags":[]},"outputs":[],"source":["# Import datasets\n","daily_activity <- read.csv(\"../input/capestone-bellabeat/dailyActivity_merged.csv\")\n","daily_steps <- read.csv(\"../input/capestone-bellabeat/dailySteps_merged.csv\")\n","daily_sleep <- read.csv(\"../input/capestone-bellabeat/sleepDay_merged.csv\")\n","weight_log <- read.csv(\"../input/capestone-bellabeat/weightLogInfo_merged.csv\")"]},{"cell_type":"markdown","id":"4645ebff","metadata":{"papermill":{"duration":0.029932,"end_time":"2023-03-27T21:31:59.406063","exception":false,"start_time":"2023-03-27T21:31:59.376131","status":"completed"},"tags":[]},"source":["> ****\n","#### <span style=\"color:#4682B4\"> 5.3 Preview data and columns prior to cleaning </span> <a class=\"anchor\" id=\"preview_columns_prior_to_cleaning_5_3\"></a>\n","\n","I will preview the selected datasets in addition to their column names."]},{"cell_type":"code","execution_count":3,"id":"7380ca6f","metadata":{"execution":{"iopub.execute_input":"2023-03-27T21:31: