false,"start_time":"2023-03-27T21:32:02.096422","status":"completed"},"tags":[]},"source":["* **From this bar chart, I now better understand how active users are. The sedentary minutes are significantly higher than the other categories, suggesting the users frequently sit every day.**\n","\n","\n","## <span style=\"color:#4682B4\"> 6.1 Analysis Phase of Activity </span> <a class=\"anchor\" id=\"analysis_of_activity_6_1\"></a>\n","\n","Let's compare the average total amount of activity users have throughout the day, compared with the average sedentary level and the CDC activity recommendation.\n","\n","The information was gathered from here: https://www.cdc.gov/physicalactivity/basics/adults/index.htm\n","\n","\n","First, I'll import the cowplot package to get the visuals that will best show the comparison."]},{"cell_type":"code","execution_count":11,"id":"a0c31c91","metadata":{"_kg_hide-output":false,"execution":{"iopub.execute_input":"2023-03-27T21:32:02.222512Z","iopub.status.busy":"2023-03-27T21:32:02.220408Z","iopub.status.idle":"2023-03-27T21:32:02.293312Z","shell.execute_reply":"2023-03-27T21:32:02.291171Z"},"papermill":{"duration":0.121143,"end_time":"2023-03-27T21:32:02.296076","exception":false,"start_time":"2023-03-27T21:32:02.174933","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["\n","Attaching package: ‘cowplot’\n","\n","\n","The following object is masked from ‘package:lubridate’:\n","\n","    stamp\n","\n","\n"]}],"source":["library(cowplot)"]},{"cell_type":"markdown","id":"79103450","metadata":{"papermill":{"duration":0.050452,"end_time":"2023-03-27T21:32:02.388093","exception":false,"start_time":"2023-03-27T21:32:02.337641","status":"completed"},"tags":[]},"source":["> Now, I’ll go ahead and create the chart."]},{"cell_type":"code","execution_count":12,"id":"ac92cf25","metadata":{"execution":{"iopub.execute_input":"2023-03-27T21:32:02.465855Z","iopub.status.busy":"2023-03-27T21:32:02.464Z","iopub.status.i