inutes$difference <- 1440 - active_minutes$total_minutes\n","\n","# Print the original data frame with the difference column added\n","print(active_minutes)\n","\n","recommendation_2 <- ggplot(active_minutes, aes(x = difference, y = total_minutes)) +\n","  geom_point() +\n","  geom_hline(yintercept = 1440, linetype = \"dashed\", linewidth = 1.5, color = \"red\") + # Add the horizontal line\n","  xlab(\"Difference between actual and Theoretical values\") +\n","  ylab(\"Total minutes\")\n","recommendation_2"]},{"cell_type":"markdown","id":"a20bdf34","metadata":{"papermill":{"duration":0.044349,"end_time":"2023-03-27T21:32:06.033859","exception":false,"start_time":"2023-03-27T21:32:05.98951","status":"completed"},"tags":[]},"source":["From the graft of \"Difference between actual and Theoretical values,\" I have a red line on the y-axis to show how many minutes there are in a day (1440). Notice that a portion of users are way above 1440 minutes a day, suggesting the data collection may be inaccurate. \n","\n","\n","> I'll calculate in R to understand the percentage of users above this mark."]},{"cell_type":"code","execution_count":18,"id":"ac977213","metadata":{"execution":{"iopub.execute_input":"2023-03-27T21:32:06.126314Z","iopub.status.busy":"2023-03-27T21:32:06.124585Z","iopub.status.idle":"2023-03-27T21:32:06.154584Z","shell.execute_reply":"2023-03-27T21:32:06.152475Z"},"papermill":{"duration":0.080105,"end_time":"2023-03-27T21:32:06.157694","exception":false,"start_time":"2023-03-27T21:32:06.077589","status":"completed"},"tags":[]},"outputs":[{"name":"stdout","output_type":"stream","text":["Percent of users above the theordical limit: 21.95122 \n"]}],"source":["# Calculate the difference between the theoretical and actual values\n","active_minutes$difference <- 1440 - active_minutes$total_minutes\n","\n","# Count the number of users with total_minutes above 1440\n","num_users_above_1440 <- sum(active_minutes$total_minutes > 1440)\n","\n","# Count the number of rows in the data frame\n","num_rows <- nrow(active_minutes)\n","\n","# Count the number of non-missing values in the total_minutes column\n","num_values <- sum(!is.na(active_minutes$total_minutes))\n","\n","# Find percentage of users above the theoretical limit\n","perc_over <- (num_users_above_1440 / num_values) * 100\n","cat(\"Percent of users above the theordical limit:\", perc_over, \"\\n\")"]},{"cell_type":"markdown","id":"fd493ad5","metadata":{"papermill":{"duration":0.045075,"end_time":"2023-03-27T21:32:06.247659","exception":false,"start_time":"2023-03-27T21:32:06.202584","status":"completed"},"tags":[]},"source":["Based on these results, we can see that for almost <span style=\"color:crimson;\"><strong>22%</strong></span> of users, their total minutes are above <strong>1440<strong/>.\n","\n","\n","<div style=\"color:white;\n","           display:fill;\n","           border-radius:5px;\n","           background-color:#00F099;\n","           font-size:110%;\n","           font-family:Times;\n","           letter-spacing:0.5px\">\n","\n","<p style=\"padding: 10px;\n","              color:black;\">\n","<strong>Observations:</strong> Because 22% of users' data suggest that the data collected by the smart device is over 1440 minutes, we can reasonably say that there could be an issue in the Fitbit's code in data collection. \n","</p>\n","</div>\n","<div style=\"color:white;\n","           display:fill;\n","           border-radius:5px;\n","           background-color:#00F099;\n","           font-size:110%;\n","           font-family:Times;\n","           letter-spacing:0.5px\">\n","\n","<p style=\"padding: 10px;\n","              color:black;\">\n","<strong>Recommendations:</strong> By updating the code and more accuratly collect user data, this would improve the overall functionality of the device, making it more reliable when it comes to presenting how much activity the user does per day.\n","</p>\n","</div>\n","\n","\n","We know that all the fields equal 1 day: 