- c(averages, mean(day_to_day$totalminutesasleep, na.rm = TRUE))  # add average of totalminutesasleep column\n","# Create a data frame with the averages and labels\n","df <- data.frame(activity = c(\"Very Active\", \"Fairly Active\", \"Lightly Active\", \"Sedentary\"),\n","                 minutes = averages[1:4])\n","df <- rbind(df, data.frame(activity = \"Total Time Asleep\", minutes = averages[5]))\n","\n","# Create a pie chart using ggplot2\n","recommendation_3a <- ggplot(df, aes(x = \"\", y = minutes, fill = activity)) +\n","  geom_bar(stat = \"identity\", width = 1) +\n","  coord_polar(theta = \"y\") +\n","  ggtitle(\"Average Daily Activity and Sleep\") +\n","  scale_fill_manual(values = c(\"darkgreen\", \"lightgreen\", \"yellowgreen\", \"lightblue\", \"purple\")) +\n","  theme_void() +\n","  geom_text(aes(label = paste0(round(minutes), \" min\")), \n","            position = position_stack(vjust = 0.5), size = 3, fontface = \"bold\")\n","recommendation_3a"]},{"cell_type":"markdown","id":"98cd1789","metadata":{"papermill":{"duration":0.045141,"end_time":"2023-03-27T21:32:07.087218","exception":false,"start_time":"2023-03-27T21:32:07.042077","status":"completed"},"tags":[]},"source":["This data shows that the Sedentary data is 991 minutes or roughly 16.5 hours or 59% of their day. To put it in better perspective, that is sitting down for two 8-hour shifts.\n","<div style=\"color:white;\n","           display:fill;\n","           border-radius:5px;\n","           background-color:#00F099;\n","           font-size:110%;\n","           font-family:Times;\n","           letter-spacing:0.5px\">\n","\n","<p style=\"padding: 10px;\n","              color:black;\">\n","<strong>Observations:</strong> Since the data collected is tailored to women, the most likely sample population is women working at a desk.\n","</p>\n","</div>\n","<div style=\"color:white;\n","           display:fill;\n","           border-radius:5px;\n","           background-color:#00F099;\n","       