 & mean_steps < 12500 ~ \"very active\", \n","    mean_steps >= 12500 ~ \"highly active\"\n","  ))\n","head(user_activity)\n","\n","# I want to add in percentages\n","user_type_percent <- user_activity %>%\n","  group_by(user_activity) %>%\n","  summarise(total = n()) %>%\n","  mutate(totals = sum(total)) %>%\n","  group_by(user_activity) %>%\n","  summarise(total_percent = total / totals) %>%\n","  mutate(labels = scales::percent(total_percent))\n","user_type_percent$user_activity <- factor(user_type_percent$user_activity , levels = c(\"highly active\", \"very active\", \"fairly active\", \"lightly active\", \"sedentary\"))\n","head(user_type_percent)\n","# Lets graft this\n","ggplot(user_type_percent, aes(x=\"\", y=total_percent, fill=user_activity)) +\n","  geom_bar(stat=\"identity\", width=1) +\n","  coord_polar(\"y\", start=0) +\n","  theme_void() +\n","  scale_fill_manual(values=c(\"#1f78b4\", \"#a6cee3\", \"#fdbf6f\", \"#ff7f00\", \"#e31a1c\")) +\n","  ggtitle(\"User Activity Percentage\") +\n","  labs(fill=\"User Activity\", x=NULL, y=NULL, caption=\"Source: user_activity dataset\") +\n","  geom_text(aes(label = labels), position = position_stack(vjust = 0.5))"]},{"cell_type":"markdown","id":"4cf9ff55","metadata":{"papermill":{"duration":0.046169,"end_time":"2023-03-27T21:32:08.046891","exception":false,"start_time":"2023-03-27T21:32:08.000722","status":"completed"},"tags":[]},"source":["### <span style=\"color:#4682B4\"> 6.3.1 Weekly Steps </span> <a class=\"anchor\" id=\"weekly_steps_6_3_1\"></a>\n","> Let's check out which days of the week most users are active."]},{"cell_type":"code","execution_count":22,"id":"3f5a2acf","metadata":{"execution":{"iopub.execute_input":"2023-03-27T21:32:08.144539Z","iopub.status.busy":"2023-03-27T21:32:08.142637Z","iopub.status.idle":"2023-03-27T21:32:08.631436Z","shell.execute_reply":"2023-03-27T21:32:08.628415Z"},"papermill":{"duration":0.542034,"end_time":"2023-03-27T21:32:08.635248","exception":false,"start_time":"2023-