,"\n","# Specify the order of weekdays\n","mean_bed$weekday <- factor(mean_bed$weekday, levels = c(\"Sunday\", \"Monday\", \"Tuesday\", \"Wednesday\", \"Thursday\", \"Friday\", \"Saturday\"))\n","\n","# Create a vector of colors\n","colors <- c(\"red\", rep(\"steelblue\", 3), \"darkgreen\", rep(\"steelblue\", 2))\n","\n","# Create a bar chart of mean steps per weekday\n","awake_in_bed <- ggplot(mean_bed, aes(x = weekday, y = mean_bed, fill = weekday)) +\n","  geom_bar(stat = \"identity\") +\n","  scale_fill_manual(values = colors) +\n","  labs(x = \"Day of the Week\", y = \"Average Time in Bed (minutes)\") +\n","  ggtitle(\"Average Awake Time in Bed per Day of the Week\") +\n","  geom_text(aes(label = round(mean_bed)), vjust = -0.5)\n","\n","awake_in_bed"]},{"cell_type":"markdown","id":"c406c7d8","metadata":{"papermill":{"duration":0.048826,"end_time":"2023-03-27T21:32:10.103939","exception":false,"start_time":"2023-03-27T21:32:10.055113","status":"completed"},"tags":[]},"source":["Something interesting is shown when I compare the \"Average Sleep per Day of the Week\" and the \"Average Awake Time in Bed per Day of the Week\". The average user sleeps the most on Sunday, yet, that is when they spend the most time in bed.\n","<div style=\"color:white;\n","           display:fill;\n","           border-radius:5px;\n","           background-color:#00F099;\n","           font-size:110%;\n","           font-family:Times;\n","           letter-spacing:0.5px\">\n","\n","<p style=\"padding: 10px;\n","              color:black;\">\n","My theory is, users go to bed the earliest on Sunday, however, because they aren't used to going to bed that early, they have trouble falling asleep. Hense, they tend to spend the most time in bed awake.\n","    </p>\n","    </div>\n"]},{"cell_type":"code","execution_count":25,"id":"8a003cbc","metadata":{"execution":{"iopub.execute_input":"2023-03-27T21:32:10.206722Z","iopub.status.busy":"2023-03-27T21:32:10.204884Z","iopub.status.idle":"2023-03-