ers spend in bed awake. \n","\n","This is how I will categorize time in bed:\n","* No Amount - Less than 17 min in bed.\n","* Little Amount - Between 17 and 25 min in bed.\n","* Short Amount - Between 25 and 40 min in bed.\n","* Long Amount active - Between 40 and 140 min in bed.\n","* Excessive Amount - More than 149 min in bed."]},{"cell_type":"code","execution_count":27,"id":"497fe5cd","metadata":{"execution":{"iopub.execute_input":"2023-03-27T21:32:11.565847Z","iopub.status.busy":"2023-03-27T21:32:11.563902Z","iopub.status.idle":"2023-03-27T21:32:11.777822Z","shell.execute_reply":"2023-03-27T21:32:11.775771Z"},"papermill":{"duration":0.270249,"end_time":"2023-03-27T21:32:11.780992","exception":false,"start_time":"2023-03-27T21:32:11.510743","status":"completed"},"scrolled":true,"tags":[]},"outputs":[{"data":{"text/html":["<table class=\"dataframe\">\n","<caption>A tibble: 6 × 2</caption>\n","<thead>\n","\t<tr><th scope=col>id</th><th scope=col>mean_sleep</th></tr>\n","\t<tr><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;dbl&gt;</th></tr>\n","</thead>\n","<tbody>\n","\t<tr><td>1503960366</td><td>360.2800</td></tr>\n","\t<tr><td>1644430081</td><td>294.0000</td></tr>\n","\t<tr><td>1844505072</td><td>652.0000</td></tr>\n","\t<tr><td>1927972279</td><td>417.0000</td></tr>\n","\t<tr><td>2026352035</td><td>506.1786</td></tr>\n","\t<tr><td>2320127002</td><td> 61.0000</td></tr>\n","</tbody>\n","</table>\n"],"text/latex":["A tibble: 6 × 2\n","\\begin{tabular}{ll}\n"," id & mean\\_sleep\\\\\n"," <dbl> & <dbl>\\\\\n","\\hline\n","\t 1503960366 & 360.2800\\\\\n","\t 1644430081 & 294.0000\\\\\n","\t 1844505072 & 652.0000\\\\\n","\t 1927972279 & 417.0000\\\\\n","\t 2026352035 & 506.1786\\\\\n","\t 2320127002 &  61.0000\\\\\n","\\end{tabular}\n"],"text/markdown":["\n","A tibble: 6 × 2\n","\n","| id &lt;dbl&gt; | mean_sleep &lt;dbl&gt; |\n","|---|---|\n","| 1503960366 | 360.2800 |\n","| 1644430081 | 294.0000 |\n","| 1844505072 | 652.0000 |\n","| 1927972279 | 417.0000 |\n","| 202