in bed.\n","# Long Amount active - Between 40 and 140 min in bed.\n","# Excesive Amount - More than 149 min in bed.\n","\n","# Create the time in bed frame to compare it to\n","daily_sleep <- daily_sleep %>%\n","  mutate(totaltimeawakeinbed = totaltimeinbed - totalminutesasleep)\n","colnames(daily_sleep)\n","\n","daily_sleep %>%\n","  select(totaltimeawakeinbed) %>%\n","  summary()\n","\n","# Time to calculate the users bed\n","daily_bed_ave <- daily_sleep %>%\n","  group_by(id) %>%\n","  summarise (mean_bed = mean(totaltimeawakeinbed))\n","head(daily_bed_ave)\n","\n","# Now, I will make the classifications and then a chart to represent it\n","user_bed <- daily_bed_ave %>%\n","  mutate(user_sleep = case_when(\n","    mean_bed < 17 ~ \"No Amount\",\n","    mean_bed >= 17 & mean_bed < 25 ~ \"Little Amount\", \n","    mean_bed >= 25 & mean_bed < 40 ~ \"Short Amount\", \n","    mean_bed >= 40 & mean_bed < 140 ~ \"Long Amount\", \n","    mean_bed >= 140 ~ \"Excesive Amount\"\n","  ))\n","head(user_bed)\n","\n","# Create graft to show relationship between totalminutesasleep to totaltimeawakeinbed.\n","recommendation_5b <- ggplot(daily_sleep, aes(x=totalminutesasleep, y=totaltimeawakeinbed))+\n","  geom_jitter() +\n","  geom_smooth(color = \"red\") + \n","  labs(title = \"Daily Minutes asleep vs Time Awake in Bed\", x = \"Minutes Asleep\", y= \"Minutes Awake in Bed\") +\n","  theme(panel.background = element_blank(),\n","        plot.title = element_text( size=14))"]},{"cell_type":"code","execution_count":28,"id":"829349fe","metadata":{"execution":{"iopub.execute_input":"2023-03-27T21:32:11.892603Z","iopub.status.busy":"2023-03-27T21:32:11.890389Z","iopub.status.idle":"2023-03-27T21:32:13.788334Z","shell.execute_reply":"2023-03-27T21:32:13.784481Z"},"papermill":{"duration":1.957818,"end_time":"2023-03-27T21:32:13.79183","exception":false,"start_time":"2023-03-27T21:32:11.834012","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["\u