avg_bmi, aes(label = round(bmi,2), y = bmi + 0.2), size = 3, color = \"black\") +\n","  theme_bw()"]},{"cell_type":"markdown","id":"b3165500","metadata":{"papermill":{"duration":0.055967,"end_time":"2023-03-27T21:32:16.016892","exception":false,"start_time":"2023-03-27T21:32:15.960925","status":"completed"},"tags":[]},"source":["The NA column appears because not as many users use the weight log function on their Fitbit as the activity. \n","\n","From the chart, we can see that active users tend to have lower BMI than sedentary users."]},{"attachments":{"3254cf96-3a29-41e2-8d83-374ec432ac80.png":{"image/png":""}},"cell_type":"markdown","id":"5124ba28","metadata":{"papermill":{"duration":0.056277,"end_time":"2023-03-27T21:32:16.130233","exception":false,"start_time":"2023-03-27T21:32:16.073956","status":"completed"},"tags":[]},"source":["![Cartoon_of_a_person_sitting_in_front_of_a_computer_coding_The_view_of_it_should_be_looking_at_the_back_of_their_head__3574397286.png](attachment:3254cf96-3a29-41e2-8d83-374ec432ac80.png)\n","# <span style=\"color:#4682B4\"> 7. Conclusion </span> <a class=\"anchor\" id=\"conclusion_7\"></a>"]},{"cell_type":"markdown","id":"cde7b9c3","metadata":{"papermill":{"duration":0.057287,"end_time":"2023-03-27T21:32:16.244115","exception":false,"start_time":"2023-03-27T21:32:16.186828","status":"completed"},"tags":[]},"source":["In conclusion, the Bellabeat case study analyzed the company's mission and products and identified possible avenues for expansion. Bellabeat's products aim to help women track and improve their health and wellness by providing insights into their daily activity, sleep patterns, and stress levels through their app and range of smart wellness products.\n","\n","To expand their marketing strategy, I used R to examine data from the Mobius FitBit Fitness Tracker Data in Kaggle. The data used included Daily Activity, Sleep Data, Steps Data, and Weight Log Data. It is important to note that the data had a limited sample size of 33 users, which may not represent the entire population.\n","\n","The data analysis suggests that most of the users in this sample population are women who work at desk jobs due to their high sedentary levels. \n","\n","Additionally, here are some ways Bellabeat can improve its product over a variety of features:\n","\n","<br>\n","\n","### <span style=\"color:#4682B4\"> Recommendation 1 </span> <a class=\"anchor\" id=\"recommendation_7_1\"></a>\n","\n","|Recommendation | Description |\n","|---| ---|\n","|**I recommend making a feature in the Bellabeat app that allows users to do high-intensity workouts through examples and workout examples.**| From the user activity level compared to the CDC recommendations on activity, we can see that the average user has more moderate active minutes than the CDC Recommendation, which is Great! However, the average user’s very-active activity falls way below the CDC recommendation. I think the users in the sample size do not know which high-intensity workouts they should do. Adding a feature in the Bellabeat’s app that gives users workout suggestions can significantly increase the health and amount of intense activity users do.|"]},{"cell_type":"code","execution_count":34,"id":"4f66f0e7","metadata":{"execution":{"iopub.execute_input":"2023-03-27T21:32:16.363221Z","iopub.status.busy":"2023-03-27T21:32:16.361441Z","iopub.status.idle":"2023-03-27T21:32:16.812075Z","shell.execute_reply":"2023-03-27T21:32:16.809958Z"},"papermill":{"duration":0.513503,"end_time":"2023-03-27T21:32:16.81491","exception":false,"start_time":"2023-03-27T21:32:16.301407","status":"completed"},"tags":[]},"outputs":[{"data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAA0gAAANICAIAAAByhViMAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdZ3xTZRvH8etkNN2LMsseZW9kDwVRQZZsUQQEFQUVAQFFZIoLQZAp4F4sGSoO\nEARl+IAIKEM2KLOM7pE0Oc+LQCgdaTrStKe/7ws+5M45d647OTn590xFVVUBAABA4afzdAEA\nAADIGwQ7AAAAjSDYAQAAaATBDgAAQCMIdgAAABpBsAMAANAIgh0AAIBGEOwAAAA0oqgEO9Ua\nu27htD73NS9XKszH6BUUWqJh6/snzP7s