time to fall asleep once they are in bed. While some of the outliers in the sleep data could be spoilage in the crops, it does not change the fact that people who get a good amount of sleep per night tend to have more energy throughout the day. Furthermore, having more energy throughout the day can motivate users to be more active throughout the day because they have more energy. Moreover, again, using the device more leads to increasing its popularity. Hence, more revenue.|\n"]},{"cell_type":"code","execution_count":38,"id":"4fa22389","metadata":{"execution":{"iopub.execute_input":"2023-03-27T21:32:19.151558Z","iopub.status.busy":"2023-03-27T21:32:19.149909Z","iopub.status.idle":"2023-03-27T21:32:20.190215Z","shell.execute_reply":"2023-03-27T21:32:20.188144Z"},"papermill":{"duration":1.109044,"end_time":"2023-03-27T21:32:20.193411","exception":false,"start_time":"2023-03-27T21:32:19.084367","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["\u001b[1m\u001b[22m`geom_smooth()` using method = 'loess' and formula = 'y ~ x'\n"]},{"data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAA0gAAANICAIAAAByhViMAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdZ0AUVxcG4DPbG72DihQRWxB7xcTeInaxayxRo8YGosaosWti7JrEEqOiWGON\nMZbYNbaYL3bFlkSRIp3t8/1YXBdYYIFlgfV9frF37tw50+4cpjIsyxIAAAAAlH+c0g4AAAAA\nAMwDiR0AAACAlUBiBwAAAGAlkNgBAAAAWAkkdgAAAABWAokdAAAAgJVAYgcAAABgJZDYAQAA\nAFgJK0zsWG16gETAMAyHK7iWpirtcEqBRv5848JJbZp84OJgy+cJbJ08637YZeaqXcmabC+j\n/mtxfYZhWh14WkphliFMLjyhzMunavdh4Yf+Sijt6HLKeHV6aKu6zjKBW43pJo7ycEsIwzAh\nWx6WRDzPDrdnGIYvqaLNNejcoACGYfgSf2Wu96BfGl2dYRjbilPMGMnmqk4Mw0TFZZixzVKH\nDk2vVBZFSWxUf0yslbvPya3LrTgiuj6tNsMwHc78Z8YACsUsAaS+mJ97BjlcoaNr5VbdP91/\nM95c0RLRt34ODMMcfSM3Y5vFZ8mjjBUmdgn/i3yYqSIiVquK2Pe0tMOxtLTnRxpVChw+/duT\nV+7z7T3r1qtdwU578+zheeP7eFcLvZqiLO0Ay66Kfv567vbC2GcP92/6OjTYq//SU6UdWjaz\nmnf/8dQNftXm7UOqGK3AatMvXLhw5doLy8Tj1mQsEakzH+2Nz8wxaO2xf4lInfl49X9pOQb9\ncvRfIqrUrZdFYizH3vMOzZDVLAqRcyV/A36+HkTEMDz/7DyE3NKO1Mw4XKnhDHp7OaUnPD+1\n//ue9Sv